import classes from "./../../css/Dialogs.module.css";
import { NavLink } from 'react-router-dom';

const Contacts = (props) => {
	return (
		<div>
			<h2>Контакты</h2>
			<div>
				<ul>
					<NavLink to="/dialogs/1"><li>{props.name}</li></NavLink>
				</ul>
			</div>
		</div>
	);
}

export default Contacts;
